import React, { Component } from 'react';
import { Carousel } from 'antd';
import 'antd/dist/antd.css';

const dataitems = [
    {id:'a',picurl:'contentStyle pic1',compliment:'孔武有力',time:'20210505'},
    {id:'b',picurl:'contentStyle pic2',compliment:'美若天仙',time:'20210505'},
    {id:'c',picurl:'contentStyle pic3',compliment:'可可爱爱',time:'20210505'},
    {id:'d',picurl:'contentStyle pic4',compliment:'妖艳性感',time:'20210505'},
]

class Header extends Component {
    render() { 
        return(
            <>
            <Carousel className="zone">
                {
                    dataitems.map((items) => {
                        return (
                            <div className={items.id}>
                                <div className={items.picurl}>{items.id}</div>
                                <ul className="contentStyle pic10">
                                    <li className="compliment">{items.compliment}</li>
                                    <li className="time">{items.time}</li>
                                </ul>
                            </div>
                            // <div className={items.id}>
                            //     <div className="contentStyle pic1">1</div>
                            //     <ul className="contentStyle pic10">
                            //         <li className="compliment">孔武有力</li>
                            //         <li className="time">202100505</li>
                            //     </ul>
                            // </div>
                        )
                    })
                }
            </Carousel>
            </>
        );
    }
}

export default Header;
